module.exports = "<app-vendornavbar></app-vendornavbar>\n<div class=\"wrapper wrapper-full-page\" *ngIf=\"stepFlag == 0\">\n    <!-- <div style=\"width: 100%;\"> -->\n    <div class=\"page-header login-page header-filter bg_boost\" filter-color=\"black\" style=\"background-image: url('./assets/img/vendor_login/4.jpg'); background-size: cover; background-repeat:no-repeat; background-position: top center;\">\n        <!-- <img id=\"bg\"class=\"img\"src=\"../../assets/img/vendor_login/4.jpg\" /> -->\n        <div class=\"container\" style=\"padding-top: 0%!important;\">\n            <div class=\"row\">\n                <div class=\"col-lg-8 col-md-8 bg_boost1\" style=\"padding:10%\">\n                    <h1 style=\"font-size:36px;font-weight: bold;\">Boost your Wedding Business with WedEYE</h1>\n                    <p style=\"font-size:18px; color:white;padding-top:20px\" class=\"margin-zero\">Get thousand of verified leads from all over India everyday, grow your business and expand your brand to new customers.</p>\n                    <div class=\"row\" style=\"padding-top:30px\">\n                        <div class=\"col-md-4 padding-zero\">\n                            <p style=\"font-weight: bold;color:white;font-size: 30px;\" class=\"margin-zero\">10,000+</p>\n                            <p style=\"font-weight: lighter;color:white;font-size: 18px;\">Wedding Vendors</p>\n                        </div>\n                        <div class=\"col-md-4 padding-zero\">\n                            <p style=\"font-weight: bold;color:white;font-size: 30px;\" class=\"margin-zero\">2,000+</p>\n                            <p style=\"font-weight: lighter;color:white;font-size: 18px;\">Leads Everyday</p>\n                        </div>\n                        <div class=\"col-md-4 padding-zero\">\n                            <p style=\"font-weight: bold;color:white;font-size: 30px;\" class=\"margin-zero\">20+</p>\n                            <p style=\"font-weight: lighter;color:white;font-size: 18px;\">Indian Cities</p>\n                        </div>\n                    </div>\n                </div>\n                <div class=\"col-lg-4 col-md-7 col-sm-12\" style=\"padding-top:6%\">\n                    <form [formGroup]=\"loginForm\" (ngSubmit)=\"login()\">\n                        <div class=\"card text-center\">\n                            <div class=\"card-header\">\n                                <p style=\"color:rgba(250, 93, 88, 1);font-size:20px;font-weight: bold;padding:auto;margin:auto\">Already a Vendor?</p>\n                            </div>\n                            <hr class=\"margin-zero\">\n                            <div class=\"card-body\">\n                                <div class=\"row\">\n                                    <div class=\"col-sm-2 col-form-label\">\n                                        <i class=\"material-icons\">email</i>\n                                    </div>\n                                    <div class=\"col-sm-10\">\n                                        <mat-form-field class=\"input-group\">\n                                            <input type=\"text\" matInput placeholder=\"Email Address *\" [formControl]=\"email\">\n                                            <mat-error *ngIf=\"email.hasError('patter')\">\n                                                Please input valid email address\n                                            </mat-error>\n                                            <mat-error *ngIf=\"email.hasError('required')\">\n                                                Email is <strong>required</strong>\n                                            </mat-error>\n                                        </mat-form-field>\n                                    </div>\n                                </div>\n                                <div class=\"row\">\n                                    <div class=\"col-sm-2 col-form-label\">\n                                        <i class=\"material-icons\">lock_outline</i>\n                                    </div>\n                                    <div class=\"col-sm-10\">\n                                        <mat-form-field class=\"input-group\">\n                                            <input type=\"password\" matInput placeholder=\"Password *\" [formControl]=\"hash\">\n                                            <mat-error *ngIf=\"hash.hasError('minlength')\">\n                                                At least input 6 charaters\n                                            </mat-error>\n                                            <mat-error *ngIf=\"hash.hasError('required')\">\n                                                Password is <strong>required</strong>\n                                            </mat-error>\n                                        </mat-form-field>\n                                    </div>\n                                </div>\n                                <div class=\"row\">\n                                    <a style=\"margin:auto; color:rgb(229, 57, 53); cursor:pointer\" (click)=\"gotoType()\">Go to Register</a>\n                                </div>\n                            </div>\n                            <div style=\"margin-bottom:20px\">\n\n                                <div class=\"row\">\n                                    <button mat-raised-button type=\"submit\" [disabled]=\"!loginForm.valid\" color=\"primary\" style=\"width:100%\" class=\"btn btn-danger btn-raised \">\n                        Submit\n                      </button>\n                                </div>\n                            </div>\n                        </div>\n                    </form>\n                </div>\n            </div>\n        </div>\n    </div>\n    <div class=\"container-fluid\">\n        <h2 class=\"text-center\" style=\"font-weight: bold;padding:3%\">Why Register on WedEYE?</h2>\n        <div class=\"row\">\n            <div class=\"col-md-6\">\n                <img class=\"img\" style=\"width:100%\" src=\"../../assets/img/vendor_login/sub1.png\" alt=\"\">\n            </div>\n            <div class=\"col-md-6\">\n                <div style=\"padding-bottom:20px\">\n                    <h4 style=\"color: darkgray;font-weight: bold;\">Get New Business Leads</h4>\n                    <p style=\"color: gray;font-weight: lighter;\">New customers that match your specialization, location preferences & price range. You can accept the lead & contact the customer directly, without any charges! Or you can reject the lead if you’re busy on those days, or you cannot\n                        fulfill the requirements.</p>\n                </div>\n                <div style=\"padding-bottom:20px\">\n                    <h4 style=\"color: darkgray;font-weight: bold;\">Manage your online portfolio</h4>\n                    <p style=\"color: gray;font-weight: lighter;\">Choose all the services you offer, pricing, contact details, etc. Add photos & videos of your work regularly to keep new customers engaged on your portfolio.</p>\n                </div>\n                <div>\n                    <img class=\"img\" style=\"width:25%;margin-right:10px\" src=\"../../assets/img/vendor_login/google-play.png\" alt=\"\">\n                    <img class=\"img\" style=\"width:25%\" src=\"../../assets/img/vendor_login/app-store.png\" alt=\"\">\n                </div>\n            </div>\n        </div>\n    </div>\n    <div class=\"container-fluid\" style=\"background-color: white;\">\n        <h2 class=\"text-center\" style=\"font-weight: bold;padding:3%\">Why Register on WedEYE?</h2>\n        <div class=\"row\">\n\n            <div class=\"col-md-6\" style=\"padding-left:5%;padding-right:5%\">\n                <div style=\"padding-bottom:20px\">\n                    <h4 style=\"color: darkgray;font-weight: bold;\">Intelligent Business Insights</h4>\n                    <p style=\"color: gray;font-weight: lighter;\">See how you’re performing on various factors. Learn what exactly you can do to grown your business. See how many couples are looking at your portfolio > sending you leads > finalizing deals. Get free and additional support from your\n                        WedEYE Relationship Manager, anytime!</p>\n                </div>\n                <div style=\"padding-bottom:20px\">\n                    <h4 style=\"color: darkgray;font-weight: bold;\">Receive & Reply to Reviews</h4>\n                    <p style=\"color: gray;font-weight: lighter;\">Manage your customer reviews directly from the app. Get more reviews & reply to them - generate more engagement on your WedEYE profile.</p>\n                </div>\n                <div>\n                    <img class=\"img\" style=\"width:25%;margin-right:10px\" src=\"../../assets/img/vendor_login/google-play.png\" alt=\"\">\n                    <img class=\"img\" style=\"width:25%\" src=\"../../assets/img/vendor_login/app-store.png\" alt=\"\">\n                </div>\n            </div>\n            <div class=\"col-md-6\">\n                <img class=\"img\" style=\"width:80%;margin:auto\" src=\"../../assets/img/vendor_login/sub2.png\" alt=\"\">\n            </div>\n        </div>\n    </div>\n</div>\n<!-- </div> -->\n<!-- <app-vendortype *ngIf=\"stepFlag == 1\" (selType)=\"selType($event)\"></app-vendortype> -->\n<!-- <app-vendorregister *ngIf=\"stepFlag == 2\" [selectType]=\"type\"></app-vendorregister> -->\n<app-vendorregister *ngIf=\"stepFlag == 1\" (regFlag)=\"regFlag($event)\"></app-vendorregister>"

