        if (this.auth.search_items.businessCity != undefined)
            cityValue = this.auth.search_items.businessCity;
        else
            cityValue = this.route.snapshot.params.id;
        console.log(cityValue);
        console.log(this.auth.cities);
        console.log('===== set main area xxx==========');
        var tempCity = [];
        tempCity = this.auth.cities.filter(function (o) { return (o.value == cityValue); });
