    ClientvendorsearchComponent.prototype.setHandleCheck = function (i, flag) {
        var _this = this;
        var tempCheckArr = [];
        tempCheckArr = this.searchResultTemp.filter(function (element) {
            console.log('       element          ');
            console.log(element);
            console.log(_this.isObj);
            console.log('       element          ');
            if (i == 3) {
                if (element.travelOtherIndianCities != flag)
                    return true;
                return false;
            }
            else if (i == 2) {
                if (element.roomsAvaliable != flag)
                    return true;
                return false;
            }
            else if (i == 0) {
                if (element.haveStudio != flag)
                    return true;
                return false;
            }
            else if (i == 1) {
                if (element.travelToClientVenue != flag)
                    return true;
                return false;
            }
            else {
                if (element.provideBackupDancers != flag)
                    return true;
                return false;
            }
        });
        this.searchResult = tempCheckArr;
    };
